import React, { useEffect, useState } from 'react';
const config = require('../config.json');


const ActiveUsers = () => {
    const [users, setUsers] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');

    useEffect(() => {
        fetch('http://localhost:3000/active_users') // Make sure the URL matches your server configuration
            .then(response => {

                if (!response.ok) {
                    throw new Error(`Network response was not ok: ${response.statusText}`);
                }
                return response.json();
            })
            .then(data => {
                console.log(data); // Log data to console for debugging
                setUsers(data);
                setLoading(false);
            })
            .catch(err => {
                console.error('Failed to fetch active users:', err);
                setError(`Failed to load data: ${err.message}`);
                setLoading(false);
            });

        }, []);
        console.log("useEffect is running");

    if (loading) return <div>Loading active users...</div>;
    if (error) return <div>Error loading active users: {error}</div>;
    if (!users.length) return <div>No active users found!</div>;

    return (
        <div>
            <h2>Active Users</h2>
            <ul>
                {users.map(user => (
                    <li key={user.user_id}>
                        {user.name} - Reviews: {user.review_count}
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default ActiveUsers;
